import React from "react";
import NewsGrid from "../../containers/Home/NewsGrid";
import editorsPackThumb from '../../assets/images/editors-pack-thumb.png';

function EditorPackSection({ editorPackSectionDatas, editorPackSectionDatasOne, className }) {
  // Check if editorPackSectionDatas is an array and has at least one item
  if (!Array.isArray(editorPackSectionDatas) || editorPackSectionDatas.length === 0) {
    return null; // Or handle this case as needed
  }

  // Slice the first object from the array
  const firstEditorPackData = editorPackSectionDatas[0];

  return (
    <section className={`codex-er-editors-pack-white-area ${className || ""}`}>
      <div className="container">

        <div className="row">
          <div className="col-lg-12">
            <div className="codex-er-editors-pack-title">
              <h4 className="codex-er-title">Editors Pack</h4>
            </div>
          </div>
        </div>

        <div className="row g-0 align-items-center">
          <div className="col-lg-9">
            <div className="codex-er-editors-pack-thumb">
              <img src={firstEditorPackData.image} alt="" />
            </div>
          </div>
          <div className="col-lg-3">
            <div className="codex-er-editors-pack-content">
              <div className="codex-er-meta-item">
                <div className="codex-er-meta-categories">
                  <a href="#">{firstEditorPackData.category}</a>
                </div>
                <div className="codex-er-meta-date">
                  <span>
                    <i className="fal fa-calendar-alt"></i> {firstEditorPackData.date}
                  </span>
                </div>
              </div>
              <h4 className="codex-er-title">
                <a href="#">
                  {firstEditorPackData.title}
                </a>
              </h4>
              <div className="codex-er-meta-author">
                <div className="codex-er-author">
                  <img
                    src={require('../../assets/images/user-2.png').default}
                    alt=""
                  />
                  <span>
                    By <span>{firstEditorPackData.user}</span>.
                  </span>
                </div>
              </div>
            </div>
          </div>
        </div>

        <div className="codex-er-editors-pack-item mt-60">
          <NewsGrid editorPackSectionDatas={editorPackSectionDatas} editorPackSectionDatasOne={editorPackSectionDatasOne} />
        </div>
        
      </div>
    </section>
  );
}

export default EditorPackSection;




